import axios from 'axios';
import { useEffect } from 'react';
import './App.css';

function App() {

  URL="https://pokeapi.co/api/v2/pokemon/ditto"

  useEffect(()=>{
    axios.get(URL).then((response)=> {
      console.log(response)
    }) 
  })

  return (
    <div className="App">
      <h1>Pokemon</h1>
    </div>
  );
}

export default App;
